import React from "react";

class Footer extends React.Component {
  render() {
    return (
      <div className="row">
        <div className="col-md-12 centrar">
          <p>Todos los derechos reservados 2021 @launasello</p>
        </div>
      </div>
    );
  }
}

export default Footer;
